import React, { useState } from "react"
import ReactCrop from 'react-image-crop'

export default function Cropppp(src) {

    const [crop, setCrop] = useState({
        unit: '%', // Can be 'px' or '%'
        x: 25,
        y: 25,
        width: 50,
        height: 50
      })

    return (
        <ReactCrop crop={crop} onChange={e => setCrop(e)}>
            <img src={src}/>
        </ReactCrop>
    )
}
